// ==UserScript==
// @name          Tumblr mute colors in new post icons
// @description	  Makes the new post icons a bit less garish
// @namespace     http://www.rhyley.org/gm/
// @include       http://www.tumblr.com/*
// By Jason Rhyley (jason AT rhyley DOT org)
// ==/UserScript==

(function() {

	var kil = document.createElement('style'); 
	kil.setAttribute('type','text/css'); 
	kil.appendChild(document.createTextNode('.new_post_label_icon{background-image: url(data:image/png;base64,) !important;}'));
	document.body.insertBefore(kil, document.body.firstChild); 

})();
